function process(out, label, term, rank) {
  const tokens = wanakana.tokenize(term, { detailed: true });
  const firstType = tokens[0]["type"];
  if (term.length == 1 && (firstType === "hiragana" || firstType === "katakana" || firstType === "japanesePunctuation")) {
    console.log("skip: ", term);
    return rank;
  }
  for (const token of tokens) {
    const type = token["type"];
    if (type !== "kanji" && type !== "hiragana" && type !== "katakana" && token.value !== "ー") {
      console.log("skip (token): ", term);
      return rank;
    }
  }
  if (out[term] === undefined) {
    out[term] = {};
  }
  out[term][label] = rank;
  return rank + 1;
}

function parseAndDump() {
  const out = {};

  // Innocent
  {
    const words = JSON.parse(InnocentSource);
    let rank = 1;
    for (let i = 0; i < words.length && i < 10000; ++i) {
      const entry = words[i];
      const term = entry[0];
      rank = process(out, "i", term, rank);
    }
  }

  // Wiki
  {
    const words = WikiSource.split(";");
    let rank = 1;
    for (const word of words) {
      const [_, freq, term] = word.split(",");
      rank = process(out, "w", term, rank);
    }
  }

  // Anime
  {
    const words = AnimeSource.split(";");
    let rank = 1;
    for (const word of words) {
      rank = process(out, "a", word, rank);
    }
  }

  console.log(JSON.stringify(out));
}
